const { createTheme } = require("@mui/system");

export const Colors = {
    primary: "#00adb5",
    secondary: "#00c7c0",
    success: "#4caf50",
    info: "#00d5ff",
    danger: "#FF5722",
    warning: "#FFC107",
    dark: "#22414d",
    light: "#aaa",
    muted: "#abafb3",
    border: "#DDDFE1",
    inverse: "#2F3D4A",
    shaft: "#333",
    dove_gray: "#d5d5d5",
    body_bg: "#7A79B3",
    white: "#fff",
    black: "#000",
};

export const overrides = {
    palette: {
        primary: {
            main: Colors.primary
        },
        secondary: {
            main: Colors.secondary
        },
    },
    components: {

    }
};

export const theme = createTheme({
    ...overrides
})
